    numberValidation(num) {
        if (num.length === 10 && num.match('(0/91)?[6-9][0-9]{9}')) {
            this.currentContact = num;
            this.checkUrl(num).subscribe((data) => {
                const text = data.apiwha_autoreply;
                const id = data.id;
                localStorage.setItem('id', id);
                this.getCredits();
                console.log(localStorage.getItem('id'));
                console.log(text);
                if (text.match('SHOW')) {
                    this.change();
                    if (this.langChanged === true) {
                        this.changeLanguage(this.currentContact, localStorage.getItem('language')).subscribe((data) => {
                            console.log(data);
                        }, (error) => {
                            console.log(error);
                        });
                        this.langChanged = false;
                    }
                    this.repeatMEssage('SHOW', num);
                }
                else {
                    this.botui.message.add({
                        loading: true,
                        delay: 500,
                        content: text
                    }).then(() => {
                        this.botui.action.button({
                            action: [{
                                    text: 'REGISTER',
                                    value: 'REGISTER'
                                }]
                        }).then(() => {
                            this.router.navigateByUrl('register');
                        });
                    });
                }
            }, (error) => {
                console.log(error);
            });
        }
        else {
            this.botui.message.add({
                loading: true,
                delay: 500,
                content: '       '
            }).then(() => {
                this.botui.action.text({
                    action: {
                        sub_type: 'number',
                        placeholder: 'Enter your mobile number'
                    }
                }).then(res => {
                    this.numberValidation(res.value);
                });
            });
        }
    }
